quid diamine with a distinctive unpleasant odour, it is a homologue of putresceine and is formed by the bacterial decarboxylation of lysine that occurs during protein hydrolysis during putrefaction of animal tissue. It is also found in plants such as soyabean. It has a role as a plant metabolite, a Daphnia magna metabolite, an Escherichia coli metabolite and a mouse metabolite. It is a conjugate base of a cadaverine(2+).'),(274,'C1C2C(C(C(O2)N3C=NC4=C(N=CN=C43)N)O)OP(=O)(O1)O','6-(6-aminopurin-9-yl)-2-hydroxy-2-oxo-4a,6,7,7a-tetrahydro-4H-furo[3,2-d][1,3,2]dioxaphosphinin-7-ol','Acrasin','C10H12N5O6P',329.21,'Acrasin;NSC94017;6-(6-aminopurin-9-yl)-2-hydroxy-2-oxo-4a,6,7,7a-tetrahydro-4H-furo[3,2-d][1,3,2]dioxaphosphinin-7-ol;24493-93-4;Cyclic Adenosine Monophosphate;Adenosine-3\',5\'-cyclic phosphate;NSC-94017;Adenosine 3\'-,5\'-cyclic monophosphate;ara-cAMP;Probes1_000341',NULL),(275,'C(CON=C(N)N)C(C(=O)O)N','2-amino-4-(diaminomethylideneamino)oxybutanoic acid','DL-Canavanine','C5H12N4O3',176.17,'DL-Canavanine;(L)-CANAVANINE;O-{[amino(imino)methyl]amino}homoserine sulfate (salt);13269-28-8;Canavanine, DL-;AI3-52153;(+/-)-Canavanine;Canavanine, (+/-)-;Canavanine DL-form [MI];Homoserine, O-((aminoiminomethyl)amino)-','DL-Canavanine is an alpha-amino acid.'),(276,'C(=O)(N)[O-]','carbamate','Carbamate','CH2NO2-',60.03,'carbamate;Carbamate ion;Carbamic acid, ion(1-);302-11-4;Carbamates;carboxyamide;Carbamat;Karbamat;carboxy-amide;racemic carbamate','Carbamate is an amino-acid anion. It is a conjugate base of a carbamic acid.'),(277,'C(=O)(N)O','carbamic acid','Carbamic acid','CH3NO2',61.04,'CARBAMIC ACID;Aminoformic acid;463-77-4;UNII-O0UC6XOS4H;aminocarboxylic acid;O0UC6XOS4H;CHEBI:28616;Aminoformate;Carbamidsaeure;ammoniocarboxylate','Carbamic acid is a one-carbon compound that is ammonia in which one of the hydrogens is replaced by a carboxy group. Although carbamic acid derivatives are common, carbamic acid itself has never been synthesised. It has a role as an Esch