 an antagonist, a member of greenhouse gas, a human metabolite, a member of food packaging gas, a food propellant, a refrigerant, a Saccharomyces cerevisiae metabolite, an Escherichia coli metabolite and a mouse metabolite. It is a one-carbon compound, a gas molecular entity and a carbon oxide.'),(281,'[C-]#[O+]','carbon monoxide','Carbon monoxide','CO',28.01,'carbon monoxide;carbon monooxide;Carbonic oxide;630-08-0;carbon(II) oxide;Carbon oxide (CO);UNII-7U1EE4V452;Carbon monoxide [USAN];[CO];CHEBI:17245','Carbon monoxide is a one-carbon compound in which the carbon is joined only to a single oxygen. It is a colourless, odourless, tasteless, toxic gas. It has a role as a neurotoxin, a signalling molecule, a vasodilator agent, a neurotransmitter, a metabolite, a P450 inhibitor, a ligand, a biomarker, a probe, a human metabolite, a mouse metabolite, an EC 1.9.3.1 (cytochrome c oxidase) inhibitor and a mitochondrial respiratory-chain inhibitor. It is a one-carbon compound, a gas molecular entity and a carbon oxide. It is a conjugate base of a carbon monoxide(1+).'),(282,'C1=CC(C(C(=C1)CCC(=O)O)O)O','3-(5,6-dihydroxycyclohexa-1,3-dien-1-yl)propanoic acid','3-(5,6-Dihydroxycyclohexa-1,3-dien-1-yl)propanoic acid','C9H12O4',184.19,'SCHEMBL16110446',NULL),(283,'C(=O)[O-]','formate','Formate','CHO2-',45.02,'formate;Formic acid, ion(1-);oxidooxomethyl;formate anion;71-47-6;HCO2 anion;aminate;formylate;methanoate;hydrogen carboxylate','Formate is a monocarboxylic acid anion that is the conjugate base of formic acid. Induces severe metabolic acidosis and ocular injury in human subjects. It has a role as a human metabolite and a Saccharomyces cerevisiae metabolite. It is a conjugate base of a formic acid.'),(284,'C(=O)O','formic acid','Formic acid','CH2O2',46.03,'formic acid;Methanoic acid;64-18-6;Formylic acid;Aminic acid;Bilorin;Hydrogen carboxylic acid;Formisoton;Myrmicyl;Formira','Formic acid is the simplest carboxylic acid, containing a single carbon. Occurs naturally in various sources including the venom of bee and ant stings, and is a useful organic synthetic reagent. Principally used as a preservative and antibacterial agent in livestock feed. Induces severe metabolic acidosis and ocular injury in human subjects. It has a role as an antibacterial agent, a protic solvent, a metabolite, a solvent and an astringent. It is a conjugate acid of a formate.'),(285,'C(C(=O)[O-])ON','2-aminooxyacetate','(Aminooxy)acetate','C2H4NO3-',90.06,'(aminooxy)acetate;Aminooxyacetate;2-aminooxyethanoate;2-(aminooxy)acetate;hydroxylamine-O-acetic acid;CHEBI:157642;A20598','(aminooxy)acetate is a monocarboxylic acid anion that is the conjugate base of (aminooxy)acetic acid, resulting from the deprotonation of the carboxy group. Major microspecies at pH 7.3. It is a conjugate base of an (aminooxy)acetic acid.'),(286,'C(C(=O)O)ON','2-aminooxyacetic acid','Aminooxyacetic acid','C2H5NO3',91.07,'Aminooxyacetic acid;(aminooxy)acetic acid;645-88-5;2-(Aminooxy)acetic acid;AOAA;Aminooxy-acetic acid;carboxymethoxylamine;Carboxymethoxyamine;ACETIC ACID, (AMINOOXY)-;(Carboxymethoxy)amine','(aminooxy)acetic acid is a member of the class of hydroxylamines that is acetic acid substituted at postion 2 by an aminooxy group. It is a compound which inhibits aminobutyrate aminotransferase activity in vivo, resulting in increased levels of gamma-aminobutyric acid in tissues. It has a role as a nootropic agent, an EC 4.2.1.22 (cystathionine beta-synthase) inhibitor, an EC 2.6.1.19 (4-aminobutyrate--2-oxoglutarate transaminase) inhibitor and an anticonvulsant. It is an amino acid, a member of hydroxylamines and a monocarboxylic acid. It is a conjugate acid of an (aminooxy)acetate.'),(287,'C1=CC=C(C(=C1)C(=O)O)NCC(=O)C(C(COP(=O)(O)O)O)O','2-[(3,4-dihydroxy-2-oxo-5-phosphonooxypentyl)amino]benzoic acid','2-[(3,4-Dihydroxy-2-oxo-5-phosphonooxypentyl)amino]benzoic acid','C12H16NO9P',349.23,NULL,NULL),(288,'C[N+](C)(C)CC(CC(=O)[O-])O','3-hydroxy-4-(trimethylazaniumyl)butanoate','